‼️Інформація від мерії Одеси

ЯК ПОВОДИТИСЯ НА БЛОКПОСТАХ

❗️В умовах воєнного стану в Україні вводиться особливий безпековий режим. В країні діє комендантська година та встановлені блокпости.

Шановні одесити!
Задля вашої безпеки при проходженні блокпосту:
✔️зменшіть швидкість автомобіля;
✔️завчасно підготуйте документи для перевірки;
✔️вимкніть фари;
✔️увімкнить аварійне світло;
✔️не ведіть відеозйомку;
✔️без дозволу військових не виходьте з автомобіля;
✔️чітко відповідайте на запитання військових;
✔️будьте готові на вимогу відкрити багажник та оглянути салон автомобіля;
✔️не заходьте за спину військовим під час огляду багажника/салону;
✔️після огляду та дозволу подовжити рух не набирайте швідкість різко.

У місті дотримуйтесь правил дорожнього руху та поведінки у громадських місцях.

Зберігайте спокій!
Разом - ми сила!

СМЕРТЬ РОССИЙСКИМ ОККУПАНТАМ!

